As the weather gets colder, few things are more appealing than curling up with a good book. In celebration of this quintessential winter pursuit, weve rounded up 15 spaces that feature beautiful, inspired book displays and bookshelves. Scroll down to give new meaning to the term literary arts.

For a recent project in Brooklyns Boerum Hill neighborhood, design studio<a href="http://www.workstead.com/">Workstead</a>built a library of beech millwork, outfitting it with locally designed and fabricated furniture, to house the clients ample book collection.

The Manhattan loft of design duo<a href="http://www.romanandwilliams.com/">Roman and Williams</a> a partnership between Robin Standefer and Stephen Alesch  is furnished exclusively with vintage finds, many from former factories. The library at the rear is part of Aleschs studio.

Two more designs by Jayne. Left: At Drumlin Hall, in New Yorks Hudson River Valley, Jayne created a library that does double duty as a relaxed space for cocktails and after-dinner conversation  hence the pull-down bar in one of its archways. Right: Shelves lined with books and dotted with<a href="https://www.1stdibs.com/furniture/style/pre-columbian/">pre-Columbian</a>pieces flank a fireplace and Blue Period<a href="https://www.1stdibs.com/creators/pablo-picasso/art/">Picasso</a>in an apartment Jayne created on Manhattans Beekman Place in 2011. The early-20th-century<a href="https://www.1stdibs.com/furniture/rugs-carpets/style/aubusson/">Aubusson carpet</a>was a family heirloom of the clients

